import React,{ Component } from 'react';
import Slider from "react-slick";
import {
    BannerWrap
} from '../component/lbstyle';
class LeftBanner extends Component {
    render() {
        var settings = {
            dots: true,
            infinite: true,
            speed: 500,
            slidesToShow: 1,
            slidesToScroll: 1
        };
        return (
            <Slider {...settings}>
                <BannerWrap><img className='img' src='http://pic.90sjimg.com/back_pic/qk/back_origin_pic/00/04/28/1db9f61fa1dee3b2224f7d22510f3a46.jpg'/></BannerWrap>
                <BannerWrap><img className='img' src='http://img15.3lian.com/2015/h1/258/d/61.jpg'/></BannerWrap>
                <BannerWrap><img className='img' src='http://b-ssl.duitang.com/uploads/blog/201511/04/20151104122450_vLa4t.jpeg'/></BannerWrap>
                <BannerWrap><img className='img' src='../../../static/bannerImg/2.jpeg'/></BannerWrap>
                <BannerWrap><img className='img' src='../../../static/bannerImg/3.jpg'/></BannerWrap>
            </Slider>
        );
    }
}
export default LeftBanner;
